const moment = require('moment');
require('moment-duration-format');
const start = this.getDBM().Audio.dispatchers[server.id].player.streamingData.startTime;
const duration =  this.getDBM().Audio.playingnow[server.id][1].duration;
const timeLeft = moment.duration((start + duration * 1000) - Date.now()).format('d [days] h [hours] m [minutes] s [seconds]');
Actions.storeValue(timeLeft, 1, 'timeLeft', cache);
Actions.callNextAction(cache);

if (!Audio.queue[server.id] || Audio.queue[server.id].length < 1) {
    msg.channel.send('The queue is empty.');
} else {
    const titles = [];
    const g = Audio.queue[server.id];
    for (const i in g) {
        titles.push(g[i][1].title + '\n');
    }
    const embed = new DiscordJS.RichEmbed();
    embed.setDescription(`\`\`\`${titles.toString().replace(/,/g, '')}\`\`\``);
    msg.channel.send(embed);
}

